import React from 'react';
import { View, StyleSheet } from 'react-native';
import './square.css';

/**
 * props:
 *
 * type - 
 * x    - 
 * y    - 
 */
class Square extends React.Component {
	render() {
		return (
			<div className="square">
				<View style={styles.square}/>
			</div>
		);
	}
}

export default Square;

const styles = StyleSheet.create({
	square: {
		width: 100,
	    height: 100,
	    backgroundColor: 'red'
	}
});
